import React, { Component } from 'react';
import './App.css';

class App extends Component {

  // componentDidMount() {
  //   fetch('http://127.0.0.1:1812/')
  //       .then(Response => Response.json())
  //       .then(console.log)
  // }


  render() {
    const slider = document.getElementById("slider-value")
    const slider_output = document.getElementById("slider-output")

    slider_output.innerHTML = slider.value;

    slider.oninput = () =>{
      slider_output.innerHTML =this.value;
    }

    return (
      <div className="App">
        <div>
          <input placeholder="ENTER YOU AGE"></input><br />

          <label htmlFor="male" >Male</label>
          <input  type="radio" name="gender" value="male"></input>

          <label htmlFor="female">Female</label>
          <input  type="radio" name="gender" value="female"></input><br />
          <label>
            <b>Chest Pain Type:</b><br />
                    <span />0: Typical angina: chest pain related decrease blood supply to the heart<br />
                    <span />1: Atypical angina: chest pain not related to heart<br />
                    <span />2: Non-anginal pain: typically esophageal spasms (non heart related)<br />
                    <span />3: Asymptomatic: chest pain not showing signs of disease <br />
          </label>
          <input  type="number" min="0" max="4" step="1" ></input><br />

          <label></label>
          <input id="slider-output" ></input>
          <input  type="range" min="94" max="200" step="1" id="slider-value"></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input><br />
          <input  type="" ></input>
        </div>
      </div>
    );
  }
}

export default App;
